import React from 'react';
import PropTypes from 'prop-types';

const Title = ({ title }) => {
  // const onClick = () => {
  //     console.log('click')
  // }
  return (
    <div>
      <h3>Daniel Bradley</h3>
      <h1>Web.Photo.Video</h1>
      <a className="navbar-brand btn-primary" href="#">Enter</a>


    </div>

  );
};

Title.defaultProps = {
  title: 'Daniel Bradley',
};

Title.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Title;
